import React, { useState, useEffect } from 'react';
import Preview3DApi from './Preview3DApi';
import WebViewer3D from './WebViewer3D';
import Preview2DApi from './Preview2DApi';
import Footer from './Footer';
import boschrexrothlogo from './boschrexrothlogo.svg';
import { defineCustomElements } from '@boschrexroth/nextgen-web-ui-toolkit-react';
defineCustomElements();

const TableDataApi = () => {
  const [data, setData] = useState(null);
  const [apiData, setApiData] = useState(null);
  const [miDent, setMiDent] = useState('');
  const [selectedLanguage, setSelectedLanguage] = useState('english');
  const [selectedValues, setSelectedValues] = useState({
    DR: '',
    PC: '',
    PM: '',
    ST: '',
    CT: '',
    FD: ''
  });

  const [showInfo, setShowInfo] = useState(false);

  const handleApiData = (data) => {
    setApiData(data);
  };

  useEffect(() => {
    const fetchData = async () => {
      try {
        const params = {
          apikey: 'e66120f9d9624823884cac1bf290ea88',
          language: selectedLanguage,
          eol: '1',
          plm: 'true',
          includeunclassifiedbycountry: 'false',
          enablePreviewPerLine: 'true',
          path: 'bosch_rexroth_cytro/power_units/std_power_units/cytropac_asmtab.prj',
          includecrossref: 'true',
        };
        const queryString = new URLSearchParams(params).toString();
        const url = `https://webapi.partcommunity.com/service/table/vertical?${queryString}`;
        const response = await fetch(url);
        const result = await response.json();
        setData(result);
        setSelectedValues({
          PATH: result.index.path,
          LINEID: result.index.lineid,
          NB: result.index.NB,
          TYPE: result.index.line.values.TYP.current,
          CS: result.index.line.values.CS.current,
          TS: result.index.line.values.TS.current,
          DR: result.index.line.values.DR.current,
          PC: result.index.line.values.PC.current,
          PM: result.index.line.values.PM.current,
          OP: result.index.line.values.OP.current,
          ST: result.index.line.values.ST.current,
          CT: result.index.line.values.CT.current,
          FL: result.index.line.values.FL.current,
          COL: result.index.line.values.COL.current,
          FD: result.index.line.values.FD.current
        });
      } catch (error) {
        console.error('Error fetching the data', error);
      }
    };

    fetchData();
  }, [selectedLanguage]);

  useEffect(() => {
    updateMiDent();
  }, [selectedValues]);

  const updateMiDent = () => {
    const newMiDent = `{${selectedValues.PATH}},013 {LINEID=${selectedValues.LINEID}} {NB=${selectedValues.NB}},
                      {TYP=${selectedValues.TYPE}},{CS=${selectedValues.CS}},{TS=${selectedValues.TS}},{DR=${selectedValues.DR}},
                      {PC=${selectedValues.PC}},{PM=${selectedValues.PM}},{OP=${selectedValues.OP}},{ST=${selectedValues.ST}},
                      {CT=${selectedValues.CT}},{FL=${selectedValues.FL}},{COL=${selectedValues.COL}},{FD=${selectedValues.FD}},
                      {PPATH=cytropac_asmtpl.prj},{BAH005=380},{AAF726=8.3},{AAB456=4000},{BAD915=AC},{AAC830=20},{BAC676=G1},
                      {AAN523=Plug-in connection},{AAG402=1},{AAQ326=https://www.boschrexroth.com/ics/cat/?cat=Industrial-Hydraulics-Catalog&p=p943945},
                      {AAJ413=G1},{BAI539=},{BAB706=}`;
    setMiDent(newMiDent);
  };

  const handleChange = (field, value) => {
    setSelectedValues(prevValues => ({
      ...prevValues,
      [field]: value
    }));
  };

  const handleLanguageChange = (event) => {
    setSelectedLanguage(event.target.value);
  };

  const handleMouseEnter = () => {
    setShowInfo(true);
  };

  const handleMouseLeave = () => {
    setShowInfo(false);
  };

  if (!data) {
    return <div>Loading...</div>;
  }

  const indexPath = data.index.line.values;

  const renderRow = (label, values, fieldName, units) => (
    <tr key={fieldName}>
      <td>{label}</td>
      <td>
        {values.length === 1 ? (
          values[0].name
        ) : (
          <dc-ui-dropdown-wrapper>
            <select onChange={(e) => handleChange(fieldName, e.target.value)}>
              {values.map((item, index) => (
                <option key={index} value={item.value}>{item.name}</option>
              ))}
            </select>
          </dc-ui-dropdown-wrapper>
        )}
      </td>
      <td>{units}</td>
    </tr>
  );
  const TypecodeInfo = `${selectedValues.TYPE.split(':')[0]}-${selectedValues.CS.split(':')[0]}/${selectedValues.TS.split(':')[0]}/${selectedValues.DR}${selectedValues.PC}${selectedValues.PM}/${selectedValues.OP.split(':')[0]}/${selectedValues.ST}/${selectedValues.CT}/${selectedValues.FL.split(':')[0]}/${selectedValues.COL.split(':')[0]}`
  const ProductInfo = `CytroPac features an efficient frequency converter, integrated motor cooling, and is designed in a noise-reduced way. 
  It also includes an integrated oil drain facility and allows reduced oil volume. Furthermore CytroPac reports early warning
   signals and is ready for "Plug and run" the electrical connection. With its compact and energy-efficient design CytroPac 
   provides reduce pressure collapse (Prestart Control), reduced power consumption (Sleep) and it is suitable for continuous operation (S1).`
  const headerName = `Hydraulic power unit CytsssssssssssroPac`;

  return (
    <div>
      <div style={{paddingLeft: "1%", paddingRight: "1%"}}>
        <div style={{ backgroundColor: "#ffffff"}}>
          <div style={{ width: "15%", marginLeft: "auto", display: "block", backgroundColor: "#ffffff" }}>
            <dc-ui-dropdown-wrapper label="Language" label-position="left">
              <select value={selectedLanguage} onChange={handleLanguageChange}>
                <option value="english">English</option>
                <option value="german">German</option>
              </select>
            </dc-ui-dropdown-wrapper>
          </div>
        </div>
        <div style={{ backgroundColor: "#edf1f4", display: "flex"}}>
          <dc-ui-image
            src={boschrexrothlogo} alt="" style={{ height: "5%", width: "10%", marginLeft: "2%", paddingTop: "0.5%" , paddingBottom: "0.5%"}}>
          </dc-ui-image>
          <dc-ui-button variant="link" size="small" type="submit" style={{ marginLeft: "75%", paddingTop: "0.8%" }}>
            <dc-ui-icon name="dc_customerservice" size="small" align="center"></dc-ui-icon><br></br>
            Contact
          </dc-ui-button>
          <dc-ui-button variant="link" size="small" type="submit" style={{ paddingTop: "0.8%" }}>
            <dc-ui-icon name="dc_user" size="small" align="center"></dc-ui-icon><br></br>
            myrexroth
          </dc-ui-button>
          <dc-ui-button variant="link" size="small" type="submit" style={{ paddingTop: "0.8%" }}>
            <dc-ui-icon name="dc_cart" size="small" align="center"></dc-ui-icon><br></br>
            shopping cart
          </dc-ui-button>
        </div>
        {/* <div style={{ background: "linear-gradient(to bottom, #cad6dd, white)", display: "flex", height: "10vh" }}>
          <dc-ui-text variant="h4" color="inherit" weight="bold" text-align="left" style={{ marginLeft: "1%", paddingTop: "1.5%", paddingBottom: "0.5%" }}>
            {headerName}
          </dc-ui-text>
          <dc-ui-button variant="secondary" size="small" type="submit" style={{ marginLeft: "72%", paddingTop: "1.5%" }}>
            Consultation request
          </dc-ui-button>
        </div> */}
        <div style={{ background: "linear-gradient(to bottom, #cad6dd, white)", display: "flex", alignItems: "center", height: "10vh", padding: "0 2%" }}>
  <dc-ui-text
    variant="h4"
    color="inherit"
    weight="bold"
    text-align="left"
    style={{
      marginLeft: "1%",
      whiteSpace: "nowrap",
      overflow: "hidden",
      textOverflow: "ellipsis",
      flex: "1"
    }}
  >
    {headerName}
  </dc-ui-text>
  <dc-ui-button
    variant="secondary"
    size="small"
    type="submit"
    style={{ marginLeft: "auto", paddingTop: "1.5%" }}
  >
    Consultation request
  </dc-ui-button>
</div>

        <div style={{ display: 'flex', alignItems: 'center' }}>
          <dc-ui-button variant="primary" size="small" style={{ paddingTop: '15px', marginRight: '20px', marginLeft: "10px" }}>
            Typecode
          </dc-ui-button>
          <dc-ui-text tag="span" variant="h5" color="inherit" weight="bold" text-align="center" style={{ paddingTop: '15px', marginRight: '20px' }}>
            {TypecodeInfo}
          </dc-ui-text>
        </div>
        <div style={{ display: 'flex', alignItems: 'flex-start' }}>
          <div style={{ flex: 1 }}>
            <center>
              <h3>Product 3D View</h3>
            </center>
            <Preview3DApi miDent={miDent} onDataFetch={handleApiData} />
            <WebViewer3D apiData={apiData} />
            <div  style={{marginLeft: "30px",paddingTop: "50px" }}>
            <dc-ui-button variant="tertiary" size="normal" type="button" align="center" icon="dc_download">
                <dc-ui-text tag="span" variant="h5" color="inherit" text-align="center">download 3D Model</dc-ui-text>
            </dc-ui-button>
            <dc-ui-button variant="tertiary" size="normal" type="button" align="center" style={{marginLeft: "20px"}}>
                <dc-ui-text tag="span" variant="h5" color="inherit" text-align="center">disaplay results</dc-ui-text>
            </dc-ui-button>
            <dc-ui-button variant="tertiary" size="normal" type="button" align="center" icon="dc_info" onMouseEnter={handleMouseEnter} onMouseLeave={handleMouseLeave} style={{marginLeft: "20px"}}>
            </dc-ui-button>
              {showInfo && 
              <dc-ui-text tag="span" variant="text" color="inherit" weight="normal" text-align="left" style={{border: "2px solid rgba(0, 0, 0, 0.6)", padding: "3px",marginTop: "10px", backgroundColor: "#f9f3bc"}}>
               {ProductInfo}
               </dc-ui-text>}
            </div>
          </div>
          <div style={{ flex: 1,marginLeft: '40px' }}>
            <center>
              <h3>Product 2D View</h3>
            </center>
            <Preview2DApi />
            <div style={{marginLeft: "40px", paddingTop: "50px" }}>
            <dc-ui-button variant="tertiary" size="normal" type="button" align="center" icon="dc_download">
                <dc-ui-text tag="span" variant="h5" color="inherit" text-align="center">download 2D Model</dc-ui-text>
            </dc-ui-button>
            </div>
          </div>
          <div style={{ flex: 1}}>
            <center>
              <h3>Product Details</h3>
            </center>
            <div style={{ marginRight: "0", marginLeft: "auto", width: "800px", overflow: "hidden", border: "2px solid rgba(0, 0, 0, 0.6)", padding: "10px" }}>
              <dc-ui-table>
                <table>
                  <tbody>
                    {renderRow(indexPath.MN.desc, indexPath.MN.values, 'MN', indexPath.MN.Unit)}
                    {renderRow(indexPath.TYP.desc, indexPath.TYP.values, 'TYP', indexPath.TYP.Unit)}
                    {renderRow(indexPath.CS.desc, indexPath.CS.values, 'CS', indexPath.CS.Unit)}
                    {renderRow(indexPath.TS.desc, indexPath.TS.values, 'TS', indexPath.TS.Unit)}
                    {renderRow(indexPath.DR.desc, indexPath.DR.values, 'DR', indexPath.DR.Unit)}
                    {renderRow(indexPath.PC.desc, indexPath.PC.values, 'PC', indexPath.PC.Unit)}
                    {renderRow(indexPath.PM.desc, indexPath.PM.values, 'PM', indexPath.PM.Unit)}
                    {renderRow(indexPath.OP.desc, indexPath.OP.values, 'OP', indexPath.OP.Unit)}
                    {renderRow(indexPath.ST.desc, indexPath.ST.values, 'ST', indexPath.ST.Unit)}
                    {renderRow(indexPath.CT.desc, indexPath.CT.values, 'CT', indexPath.CT.Unit)}
                    {renderRow(indexPath.FL.desc, indexPath.FL.values, 'FL', indexPath.FL.Unit)}
                    {renderRow(indexPath.COL.desc, indexPath.COL.values, 'COL', indexPath.COL.Unit)}
                    {renderRow(indexPath.FD.desc, indexPath.FD.values, 'FD', indexPath.FD.Unit)}
                  </tbody>
                </table>
              </dc-ui-table>
            </div>
          </div>
        </div>
        </div>
        <Footer />
    </div>
  );
};

export default TableDataApi;
